import ExpenseItem from './components/Expense';

function App() {
  const items = [
    {
        date : "June 10 2003" ,
        title : "Car Insurance" ,
        amount : 294.67
    } ,

    {
        date : "Jan 05 2003" , 
        title : "life Insurance" , 
        amount : 300.99
    } ,

    {
        date : "oct 02 2003" , 
        title : "Scooty Insurance" , 
        amount : 999.09
    } ,
    {
        date: ""
    }

  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
